    [Parameter]
    public string id { get; set; }
    Tax master = new Tax();
    string strMenu = "Tax";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    int RoleId = 1;
    Privilege privi = new Privilege();
    protected async override void OnInitialized()
    {
        //RoleId = await sessionStorage.GetItemAsync<int>("RoleId");
        //CheckPriviliage
        privi = _role.PriviliageCheck(strMenu, RoleId, 1);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strEdit == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Success);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
        StateHasChanged();
    }
    private async void LoadData()
    {
        master = _tax.Edit( Convert.ToInt32(id));
    }
    private async void Save()
    {
        if (master.TaxName == string.Empty)
            {
                Snackbar.Add("Type Tax.", Severity.Info);
            }
            else
            {
                var isCheck = _tax.CheckNameId(master.TaxName);
                if (isCheck == master.TaxId || isCheck == 0)
                {
                    master.CompanyId = 1;
                    master.ModifyDate = DateTime.UtcNow;
                    _tax.Update(master);
                    Snackbar.Add("Saved Successfully.", Severity.Success);
                    navManager.NavigateTo("/setting/taxlist");
                }
                else
                {
                    Snackbar.Add("Already Exists.", Severity.Info);
                }
            }
    }
    private void CloseModel()
    {
        navManager.NavigateTo("/setting/taxlist");
    }

